script: |
  super -f text -I q9660.spq | sort > q9660.out

inputs:
  - name: q9660.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE NOT NULL NOT BETWEEN + col1 * - - CAST ( + + 77 AS REAL ) * + col2 + - 11 * - col2 * col0 AND NULL OR NOT NULL BETWEEN NULL AND - 39 - col2 + col2 * + + 60;
  - name: tab0

outputs:
  - name: q9660.out
    data: |
